void signUp(map<string, string>& users) {
    string username, password;

    cout << "Enter your desired username: ";
    cin >> username;

    // Check if the username already exists
    if (users.find(username) != users.end()) {
        cout << "Username already exists. Please choose another username.\n";
        return;
    }

    cout << "Enter your password: ";
    cin >> password;

    // Add the new user to the map
    users[username] = password;

    cout << "Sign up successful!\n";
}

// Function to log in a user
bool logIn(const map<string, string>& users) {
    string username, password;

    cout << "Enter your username: ";
    cin >> username;

    // Check if the username exists
    auto it = users.find(username);
    if (it == users.end()) {
        cout << "Username not found. Please sign up or enter a valid username.\n";
        return false;
    }

    cout << "Enter your password: ";
    cin >> password;

    // Check if the entered password matches the stored password
    if (it->second == password) {
        cout << "Login successful!\n";
        return true;
    } else {
        cout << "Incorrect password. Login failed.\n";
        return false;
    }
}

