#include <FastLED.h>

#define DEBUG 0

#if DEBUG == 1
#define debug(x) Serial.print(x)
#define debugln(x) Serial.println(x)
#else
#define debug(x)
#define debugln(x)
#endif


#define LED_PIN_A     18
#define LED_PIN_B     19
#define NUM_LEDS    30

#define B_PRESSURE 34  //  Pressure Sensor B
#define A_PRESSURE 35  // Pressure Sensor A


const float minPressure = -15.000;    // Minimum pressure corresponding to minVoltage (in Psi)
const float maxPressure = 15.000;  // Maximum pressure corresponding to maxVoltage (in Psi)

unsigned long time_delay = 0;

CRGB leds_A[NUM_LEDS];
CRGB leds_B[NUM_LEDS];

void setup() {
  Serial.begin(115200);
  delay(500);
  debugln("BEGIN");
  FastLED.addLeds<WS2812B, LED_PIN_A, GRB>(leds_A, NUM_LEDS).setCorrection(TypicalLEDStrip);
  FastLED.addLeds<WS2812B, LED_PIN_B, GRB>(leds_B, NUM_LEDS).setCorrection(TypicalLEDStrip);
  fill_solid(leds_A, NUM_LEDS, CRGB::Black);
  fill_solid(leds_B, NUM_LEDS, CRGB::Black);
  FastLED.setBrightness(25); // 10% brightness
  FastLED.show();
  pinMode(A_PRESSURE, INPUT);
  pinMode(B_PRESSURE, INPUT);
  delay(5000);

}

void loop() {
  if ( millis() - time_delay > 1000) {
    // Read the analog voltage from the sensor
    float A_P = analogRead(A_PRESSURE ) * (3.3 / 4096.0);
    float B_P = analogRead(B_PRESSURE ) * (3.3 / 4096.0);

    // Convert voltage to pressure in psi
    float B_Psi = (B_P - 0.3) / 3 * 15.000;
    float A_Psi = (A_P - 0.3) / 3 * 15.000;

    // Map pressure to LED

    int ledIndex_A = map(A_Psi, minPressure, maxPressure, 0, NUM_LEDS - 1);
    int ledIndex_B = map(B_Psi, minPressure, maxPressure, 0, NUM_LEDS - 1);

    // Set all LEDs to yellow at 50% brightness
    fill_solid(leds_A, NUM_LEDS, CHSV(60, 255, 128)); // Yellow color with 50% brightness
    fill_solid(leds_B, NUM_LEDS, CHSV(60, 255, 128)); // Yellow color with 50% brightness

    // Set the LED representing the current pressure reading to yellow at full brightness
    leds_A[ledIndex_A] = CHSV(60, 255, 255); // Yellow color with full brightness
    leds_B[ledIndex_B] = CHSV(60, 255, 255); // Yellow color with full brightness
    FastLED.show();

    debugln((String)"Voltage A" + A_P);
    debugln((String)"Voltage B" + B_P);

    debugln((String)"A PSI " + A_Psi + " Psi");
    debugln((String)"B PSI " + B_Psi + " Psi");

    debugln((String)"LED INDEX A" + ledIndex_A);
    debugln((String)"LED INDEX B" + ledIndex_B);
    time_delay = millis();
  }
}
